import React from 'react';
import './App.css';
import { Navbar, NavbarBrand } from 'reactstrap';
import Main from './components/Main'

function App() {
  return (
    <div className="App">
      <Navbar dark color="primary">
        <div className="container">
          <NavbarBrand href="/">Conway's Game of Exploding Bunnies</NavbarBrand>
        </div>
      </Navbar>

      <Main />
    </div>
  );
}

export default App;
